  true,\n\t\"url\": null,\n\t\"notes\": \"The Business Identification Number Cross-reference
  System (BINCS) is an all-in-one search engine that identifies foreign and domestic
  government/commercial contractors, manufacturers and suppliers. The system contains
  information on half a million businesses worldwide. Information in the system is
  cross-referenced to permit inquiry by CAGE, DUNS, company name, phone number, country,
